import React from 'react';
import { Document, Page } from 'react-pdf';

const ResumeViewer = () => {
  const pdfUrl = process.env.PUBLIC_URL + '/files/rodriguez2024.pdf';

  return (
    <div>
      <h1>Resume</h1>
      <Document file={pdfUrl}>
        <Page pageNumber={1} />
      </Document>
    </div>
  );
};

export default ResumeViewer;
